The resource estimator estimates and predicts the total resources used on the agent and informs the master about resources that can be oversubscribed. By default, Mesos comes with a noop and a fixed resource estimator. The noop estimator only provides an empty estimate to the agent and stalls, effectively disabling oversubscription. The fixed estimator doesn't use the actual measured slack, but oversubscribes the node with fixed resource amount (defined via a command line flag). The interface is defined below: class ResourceEstimator
{
public: // Initializes this resource estimator. This method needs to be // called before any other member method is called. It registers // a callback in the resource estimator. The callback allows the // resource estimator to fetch the current resource usage for each // executor on agent. virtual Try<Nothing> initialize( const lambda::function<process::Future<ResourceUsage>()>& usage) = 0; // Returns the current estimation about the *maximum* amount of // resources that can be oversubscribed on the agent. A new // estimation will invalidate all the previously returned // estimations. The agent will be calling this method periodically // to forward it to the master. As a result, the estimator should // respond with an estimate every time this method is called. virtual process::Future<Resources> oversubscribable() = 0;
};

