Because standalone containers are launched directly on Mesos Agents, these containers do not participate in the Mesos Master's offer cycle. This means standalone containers can be launched regardless of resource allocation and can potentially overcommit the Mesos Agent, but cannot use reserved resources. An Operator API might look like this: LAUNCH_CONTAINER HTTP Request (JSON): POST /api/v1 HTTP/1.1 Host: agenthost:5051
Content-Type: application/json { "type": "LAUNCH_CONTAINER", "launch_container": { "container_id": { "value": "my-standalone-container-id" }, "command": { "value": "sleep 100" }, "resources": [ { "name": "cpus", "scalar": { "value": 2.0 }, "type": "SCALAR" }, { "name": "mem", "scalar": { "value": 1024.0 }, "type": "SCALAR" }, { "name": "disk", "scalar": { "value": 1024.0 }, "type": "SCALAR" } ], "container": { "type": "MESOS", "mesos": { "image": { "type": "DOCKER", "docker": { "name": "alpine" } } } } }
} The Agent will return: 200 OK if the launch succeeds, including fetching any container images or URIs specified in the launch command. 202 Accepted if the specified ContainerID is already in use by a running container. 400 Bad Request if the launch fails for any reason. NOTE: Nested containers share the same Operator API. To launch a nested container, the ContainerID needs to have a parent; and no resources may be specified in the request.

