Standalone containers are not managed by a framework, do not use executors, and therefore do not have status updates. They are not automatically relaunched upon completion/failure. After launching a standalone container, the operator should monitor the container via the WAIT_CONTAINER call: WAIT_CONTAINER HTTP Request (JSON): POST /api/v1 HTTP/1.1 Host: agenthost:5051
Content-Type: application/json
Accept: application/json { "type": "WAIT_CONTAINER", "wait_container": { "container_id": { "value": "my-standalone-container-id" } }
} WAIT_CONTAINER HTTP Response (JSON): HTTP/1.1 200 OK Content-Type: application/json { "type": "WAIT_CONTAINER", "wait_container": { "exit_status": 0 }
} This is a blocking HTTP call that only returns after the container has exited. If the specified ContainerID does not exist, the call returns a 404.

