A standalone container can be signalled (usually to kill it) via this API: KILL_CONTAINER HTTP Request (JSON): POST /api/v1 HTTP/1.1 Host: agenthost:5051
Content-Type: application/json { "type": "KILL_CONTAINER", "kill_container": { "container_id": { "value": "my-standalone-container-id" } }
} KILL_CONTAINER HTTP Response (JSON): HTTP/1.1 200 OK If the specified ContainerID does not exist, the call returns a 404.
